import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

state = {
    unidentified: [

    ]
}

style = {
    overflow: 'scroll',
    height: '350px'
}

render(){

    setInterval(()=>{
        let stateCopy = {...state}
        stateCopy.unidentified.push(<FeedItem>abcdef</FeedItem>)
        console.log(stateCopy.unidentified)
        this.setState(stateCopy)
    }, 3000)

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        {this.state.unidentified}
    </div>)}
}


export default unregisteredFeed
